import React from "react";
import "./SupportedConversions.css";
import { conversionsData, adapters } from "../../dummydata";
import Heading from "../common/heading/Heading";

const SupportedConversions = () => {
  return (
    <section className="supportedConversions">
      <div className="container">
        <Heading subtitle="CONVERSIONS" title="Supported Conversions" />
        
        {/* MX to MT Conversions */}
        <div className="conversion-category">
          <h2>MX to MT Conversions</h2>
          <div className="conversion-grid">
            {conversionsData.mxToMt.map((item, index) => (
              <ConversionCard key={index} conversion={item} />
            ))}
          </div>
        </div>
        
        {/* MT Conversions */}
        <div className="conversion-category">
          <h2>MT Conversions</h2>
          <div className="conversion-grid">
            {conversionsData.mt.map((item, index) => (
              <ConversionCard key={index} conversion={item} />
            ))}
          </div>
        </div>
        
        {/* Fedwire to ISO20022 Conversions */}
        <div className="conversion-category">
          <h2>Fedwire to ISO20022 Conversions</h2>
          <div className="conversion-grid">
            {conversionsData.fedwire.map((item, index) => (
              <ConversionCard key={index} conversion={item} />
            ))}
          </div>
        </div>

        {/* Connectivity Adapter Support */}
        <div className="conversion-category">
          <h2>Connectivity Adapter Support</h2>
          <div className="conversion-grid">
            {adapters.map((adapter, index) => (
              <AdapterCard key={index} adapter={adapter} />
            ))}
          </div>
        </div>
      </div>
    </section>
  );
};

const ConversionCard = ({ conversion }) => (
  <div className="conversion-card">
    <h3>{conversion.from} to {conversion.to}</h3>
    <button className="outline-btn">Learn More</button>
  </div>
);

const AdapterCard = ({ adapter }) => (
  <div className="adapter-card">
    <h3>{adapter.name}</h3>
  </div>
);

export default SupportedConversions;
